import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: flex-start;
  padding: 17px 0 47px 0;
  width: 100%;
  height: 396px;
  background: linear-gradient(
    270deg,
    #efac86 -1.13%,
    #f1b758 101.86%,
    #f1b758 101.87%
  );
  h3 {
    position: absolute;
    width: 432px;
    height: 48px;
    left: 433px;
    top: 1598px;

    font-family: Poppins;
    font-style: normal;
    font-weight: 600;
    font-size: 32px;
    line-height: 48px;
    /* identical to box height */

    text-align: center;

    color: #ffffff;
  }
`;
